//import logo from '../public/lo';
//import './App.css';
import RoleSelection from './components/RoleSelection.jsx'
import Login from './components/User'
import LoginVenue from './components/login-venue.jsx'
import Registration from './components/Registration.jsx'
import HomeRequest from './components/HomeRequest.jsx'
import React from 'react'
import {BrowserRouter, Routes, Route} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<RoleSelection />}></Route>
        <Route path='/login' element={<Login />}></Route>
        <Route path='/login-venue' element={<LoginVenue />}></Route>
        <Route path='/regist' element={<Registration />}></Route>
        <Route path='/home' element={<HomeRequest />}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
